import React from 'react';

import Link from 'next/link';

const NavBar=()=>{
  return(
    <div className='bg-gray-500 py-4'>
      <Link href='/Sobre'>
        <a>Sobre</a>
      </Link>
      <Link href='/Cadastro'>
        <a>Cadastre-se</a>
      </Link>
      <Link href='/Login'>
        <a>Entrar</a>
      </Link>
    </div>
  );
}

export default NavBar;
